Here is the contract based on your description:

```solidity
pragma solidity ^0.4.24;

contract Token {
    mapping (address => uint256) public balanceOf;
    mapping (address => mapping (address => uint256)) public allowance;
    mapping (address => bool) public frozenaccount;
    string public name;
    string public symbol;
    uint8 public decimals;
    uint256 public totalsupply;
    uint256 public remaining;
    uint256 public ethrate;
    address public owner;
    uint256 public collectedamount;
    uint256 public icostatus;
    uint256 public tokenprice;
    address public benaddress;
    address public bkaddress;
    uint256 public allowtransfertoken;

    constructor() public {
        totalsupply = 0x108b2a2c28029094000000;
        remaining = totalsupply;
        owner = msg.sender;
        balanceOf[owner] = totalsupply;
        name = "0";
        symbol = "0";
        decimals = 18;
        ethrate = 718;
        icostatus = 1;
        tokenprice = 40;
        benaddress = 0xDB19E35e04D3Ab319b3391755e7978cb6D967DDc;
        bkaddress = 0x3706eeF0148D9408d89A0E86e09137f8dFEE02E8;
        allowtransfertoken = 0;
    }

    function approve(address _spender, uint256 _value) public {
        allowance[msg.sender][_spender] = _value;
    }

    function changeIcoStatus(uint8 _status) public {
        require(msg.sender == owner);
        icostatus = _status;
    }

    function burn(uint256 _value) public {
        require(balanceOf[msg.sender] >= _value);
        balanceOf[msg.sender] -= _value;
        totalsupply -= _value;
    }

    function withdraw(uint256 _value) public {
        require(msg.sender == owner);
        benaddress.transfer(_value);
    }

    function() payable public {
        require(remaining > 0 && icostatus == 1);
        uint256 amount = 100 * (msg.value * ethrate) / tokenprice;
        require(amount <= remaining);
        remaining -= amount;
        collectedamount += (msg.value / 0xde0b6b3a7640000);
        require(balanceOf[owner] >= amount);
        balanceOf[owner] -= amount;
        balanceOf[msg.sender] += amount;
    }

    function transferFrom(address _from, address _to, uint256 _value) public {
        require(_value <= allowance[_from][msg.sender]);
        allowance[_from][msg.sender] -= _value;
        require(_value <= balanceOf[_from]);
        balanceOf[_from] -= _value;
        balanceOf[_to] += _value;
    }

    function setTokenPrice(uint256 _price) public {
        require(msg.sender == owner);
        tokenprice = _price;
    }

    function setEthRate(uint256 _rate) public {
        require(msg.sender == owner);
        ethrate = _rate;
    }

    function burnFrom(address _from, uint256 _value) public {
        require(balanceOf[_from] >= _value);
        require(_value <= allowance[_from][msg.sender]);
        balanceOf[_from] -= _value;
        allowance[_from][msg.sender] -= _value;
        totalsupply -= _value;
    }

    function mintToken(uint256 _amount) public {
        require(msg.sender == owner);
        balanceOf[owner] += _amount * 0xde0b6b3a7640000;
        totalsupply += _amount * 0xde0b6b3a7640000;
    }

    function setTransferStatus(uint256 _status) public {
        require(msg.sender == owner);
        allowtransfertoken = _status;
    }

    function transfer(address _to, uint256 _value) public {
        require(balanceOf[msg.sender] >= _value);
        require(balanceOf[_to] + _value >= balanceOf[_to]);
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
    }

    function approveAndCall(address _spender, uint256 _value, bytes _extraData) public {
        allowance[msg.sender][_spender] = _value;
        if(!_spender.call(bytes4(bytes32(keccak256("receiveApproval(address,uint256,address,bytes)"))), msg.sender, _value, this, _extraData)) revert();
    }

    function withdraw_all() public {
        require(msg.sender == owner);
        benaddress.transfer(0xffffffffffffffffffffffffffffffffffffffffffffffffffdc790d903f0000 + address(this).balance);
    }

    function transferOwnership(address newOwner) public {
        require(msg.sender == owner);
        balanceOf[owner] = 0;
        balanceOf[newOwner] = remaining;
        owner = newOwner;
    }

    function sellOffline(address _to, uint256 _value) public {
        require(msg.sender == owner);
        uint256 amount = _value * 0xde0b6b3a7640000;
        require(amount <= remaining);
        remaining -= amount;
        require(balanceOf[owner] >= amount);
        balanceOf[owner] -= amount;
        balanceOf[_to] += amount;
    }
}
```
